//--------------------------------------------------------------------------------------//
//                                       Projects.js                                       //
//--------------------------------------------------------------------------------------//


import React from 'react';
import Slideshow from '../Slideshow/Slideshow';
import './Projects.css'; 
import project_data from './ProjectsData'; 

function Projects() {
    return (
        <div className="projects" id="projects">
            <div className="projects__header">
                <h1>Projects</h1>
                <a href="https://github.com/KevCendana" target="_blank" className="github-logo-link" rel="noreferrer">
                    <div className="github-logo"></div>
                </a>
            </div>

            <div className="projects__section-wrapper">
                {/* Carousel for projects */}
                <div className="projects__section-wrapper">
                {/* Carousel for projects */}
                <Slideshow slides={project_data} /> {/* Pass project_data as slides */}
            </div>
            </div>
        </div>
    );
}

export default Projects;
